// Import thư viện React
import React, { Component } from 'react';
// Import các component có sẵn từ thư viện MDBReact
import {
    MDBCol,
    MDBCard,
    MDBCardImage,
    MDBCardBody,
    MDBCardTitle,
    MDBIcon,
    MDBCardFooter,
    MDBBtn,
} from 'mdbreact';

class ItemWishList extends Component {
    render() {
        return (
            <div>
                <MDBCol md='3' className='clearfix d-none d-md-block'>
                    <MDBCard narrow ecommerce className='mb-2'>
                        <MDBCardImage cascade top src='https://images.pexels.com/photos/5713738/pexels-photo-5713738.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=750&w=1260' alt='sample photo' />
                        <MDBCardBody cascade>
                            <MDBCardTitle style={{ fontSize: "21px" }} className="mb-2">
                                <strong>
                                    <a href='#!'>Nộm lạc</a>
                                </strong>
                            </MDBCardTitle>
                            <h6><strong>45.000</strong></h6>
                            <div className="mb-3">
                                <a >Xem chi tiết <MDBIcon icon="arrow-circle-right" /></a>
                            </div>
                            <MDBCardFooter className='px-1'>
                                <div className="d-flex justify-content-center">
                                    {/* Button thanh toán */}
                                    <MDBBtn className="ml-0 mr-2 orange lighten-1 border-button-1 px-3 ">
                                        <MDBIcon icon="info-circle" className="pr-1 " />Chi tiết
                                    </MDBBtn>
                                    {/* Button thêm sản phẩm vào giỏ hàng */}
                                    <MDBBtn color="warning" className="ml-0 border-button-1 px-3 py-2" outline>
                                        <MDBIcon icon="shopping-cart" className="pr-1" />Thêm vào giỏ
                                    </MDBBtn>
                                </div>
                            </MDBCardFooter>
                        </MDBCardBody>
                    </MDBCard>
                </MDBCol>
            </div>
        );
    }
}

export default ItemWishList;
